import React from 'react'

const Cart = ({products}) => {

  console.log(products);

  return (
    <div>  
     { products.map(product => <div key={product.id}>
        <h2>{product.title}</h2>
        <p>{}</p>
     </div>)}
    </div>
  )
}

export default Cart
